INSERT INTO `albums` VALUES (29,'265fd45186193395','Cánh Cung (Vol.1)',NULL,'2004','Album \"Cánh Cung\" là album đầu tay của nhạc sĩ Đỗ Bảo năm 2004. Các bài hát trong album là một câu chuyện tình nhỏ, có những nhân vật cụ thể trong ấy.  Người nghe sẽ rất dễ dàng bắt được mạch cảm xúc của bài hát khi thấy thấp thoáng trong từng câu chuyện tình là hình ảnh của bản thân mình, là tình cảm của chính con người mình trong ấy : Bức thư tình đầu tiên, Bức thư tình thứ hai, Điều ngọt ngào nhất, Cánh cung, Anh đã khác xưa...',1,NULL),(30,'d4c5b24a28f1ffbc','Thời Gian Để Yêu (Vol.2)',NULL,'2008','Từ sau Bức Thư Tình Thứ 2 thì đến album này, chúng ta sẽ được gặp lại một Đỗ Bảo với những ca từ lãng mạn, trong vắt trong \"Bức Thư Tình Thứ 4\" với tiếng hát của Hồ Quỳnh Hương. Hay là những ca khúc với lời lẽ bay bổng, du dương như \"Mây\", \"Thời Gian Để Yêu\"...',NULL,NULL),(32,'33a59c339e7ab9f5','Giáng Sinh',NULL,'1998','null',NULL,NULL),(33,'4e5e3cc80f860194','Lãng Đãng Chiều Đông Hà Nội',NULL,'2001','Album tổng hợp những ca khúc trữ tình hay nhất của nhạc sĩ Phú Quang, được thể hiện qua những giọng ca Mỹ Linh, Thanh Long Bass, NSND Lê Dung...',NULL,NULL),(34,'e1ff391eb7875d7e','Trong Ánh Chớp Số Phận (Vol.3)',NULL,'1997','null',NULL,NULL),(35,'0710293410729a1b','Về Lại Phố Xưa (Vol.5)',NULL,'2001','null',1,NULL),(36,'7c66d0bb6989a13c','13 Chuyện Bình Thường (Vol.8)',NULL,'2004','null',NULL,NULL),(37,'b0b14a220ebce9a1','69\'59\" (Vol.11)',NULL,'2005','null',NULL,NULL),(38,'30d0de3de832e754','Có Một Vài Điều Anh Muốn Nói Với Em (Vol.14)',NULL,'2007','null',NULL,NULL),(39,'bab862e3f747b6d7','Bình Yên (Vol.3)',NULL,'2003','null',NULL,NULL),(40,'6739f0fe28f5c6b5','Lặng Lẽ Nơi Này',NULL,'2004','Thái Hòa và tình khúc Trịnh Công Sơn',NULL,NULL),(42,'e07564c84865835d','Chiếc Lá Thu Phai',NULL,'2003','',NULL,NULL),(43,'b72c67a893416568','Bảo Yến và Những Tuyệt Phẩm Bolero',NULL,'2009','Album tuyển tập những tuyệt phẩm trữ tình nổi tiếng được thể hiện qua giọng hát ngọt ngào truyền cảm c